import React, { useState } from "react";
import { TextField, Button, Select, MenuItem } from "@mui/material";
import { useLocation, useNavigate } from "react-router-dom";

function Order() {
  const navigate = useNavigate();
  const location = useLocation();
  const [form, setForm] = useState({
    firstName: "",
    lastName: "",
    phoneNumber: "",
    email: "",
    zipcode: 0,
    pickUpDate: Date,
    pickupTime: Date,
    numberOfServings: 0,
    orderType: "",
    flavor: "",
    orderDetails: "",
    refPictures: "",
  });
  const orderTypes = [
    {
      id: 1,
      value: "Cupcakes",
    },
    {
      id: 2,
      value: "Cakes",
    },
    {
      id: 3,
      value: "Cakes & Cupcakes",
    },
  ];
  return (
    <div className="py-7">
      <div className="bg-white w-2/4 h-[700px] rounded-md flex flex-row justify-around mr-auto ml-auto pl-12">
        <form
          style={{
            display: "flex",
            flexDirection: "column",
            maxWidth: "450px",
            margin: "auto",
            height: "100%",
            gap: "3rem",
          }}
        >
          <h1 className="text-2xl font-semibold py-3">Let's Get You Cake!</h1>
          <TextField
            label="First Name"
            type="text"
            variant="outlined"
            name="firstName"
            value={form.firstName}
          />
          <TextField
            label="Last Name"
            type="text"
            variant="outlined"
            name="lastName"
            value={form.lastName}
          />
          <TextField
            label="Pickup Date"
            type="date"
            variant="outlined"
            name="date"
            value={form.pickUpDate}
          />
          <TextField
            label="Pickup Time"
            type="time"
            variant="outlined"
            name="time"
            value={form.pickupTime}
          />
          <TextField
            label="Number of Servings"
            type="text"
            variant="outlined"
            name="servings"
            value={form.numberOfServings}
          />
          <Select sx={{ width: "60%", height: "10%" }}>
            {orderTypes.map((item) => (
              <MenuItem key={item.id}>{item.value}</MenuItem>
            ))}
          </Select>
          <Button variant="contained" sx={{ backgroundColor: "black" }}>
            Submit Order
          </Button>
        </form>
      </div>
    </div>
  );
}

export default Order;
